export class RomulanUniformPack extends BaseNeckProvider implements IUniformPack {

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average Male", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.Romulan) + Uniform.averageMaleBody, BodyType.AverageMale, token), "BodyType.averageMale"),
            new Swatch(BodyType.AverageFemale, "Average Female", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.Romulan) + Uniform.averageFemaleBody, BodyType.AverageMale, token), "BodyType.averageFemale"),
        ];
    }

    getRankSwatches() {
        return [
        ];
    }

    getRankIndicator(token: Token) {
        return "";
    }

    getRankBorderIndicator(token: Token) {
        return "";
    }

    getRankBorderDefinitions(token: Token, bordered: boolean) {
        return "";
    }

    getUniformAndVariantBody(token: Token) {
        let result = "";
        let neck = this.getNeck(token.bodyType, token.skinColor, token.species, UniformEra.Romulan)
        switch (token.bodyType) {
            case BodyType.AverageMale:
                result = Uniform.averageMaleBody;
                break;
            case BodyType.AverageFemale:
            default:
                result = Uniform.averageFemaleBody;
        }

        return (neck + result).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
    }

    getBorderColor(token: Token) {
        return "#559871";
    }

    getUniformVariantSwatches(token: Token) {
        return [];
    }

    getBorderLogo(token: Token): string {
        return RomulanSymbol;
    }

    isDivisionColorSupported(token: Token): boolean {
        return false;
    }
}